/*
返回表示修改后句子的字符串。
要修改的内容是，$和空格
*/
//leetcode submit region begin(Prohibit modification and deletion)
func discountPrices(sentence string, discount int) string {
	//	空格分割，然后每个子字符串遍历吧
	var ans string
	sList := strings.Split(sentence, " ")
	for _, s := range sList {
		if s[0] != '$' {
			ans = fmt.Sprintf("%s %s", ans, s)
		} else {
			n := subDis(s[1:], discount)
			ans = fmt.Sprintf("%s $%s", ans, n) //替换后的单词加入
		}
	}
	return strings.Trim(ans, " ")
	//return ans
}

func subDis(num string, discount int) string {
	res, err := strconv.Atoi(num)
	if err != nil {
		return num
	} else {
		//保留小数点后两位
		discountedPrice := float64(res) * (100 - float64(discount)) / 100
		return fmt.Sprintf("%.2f", discountedPrice)
	}
}

