func discountPrices2(sentence string, discount int) string {
	//Time Limit Exceeded
	var ans string
	//"1$2" 期望结果:"1$2" 因为不是有$2 就是正确价格， 需要时空格$2
	for i := 0; i < len(sentence); i++ {
		var num string
		var j int
		//逐个字符加入
		if i == 0 && sentence[0] == '$' {
			if i == len(sentence)-1 {
				return "$"
			}
			for j = i + 1; j < len(sentence); j++ {
				if sentence[j] == ' ' {
					num = sentence[i+1 : j]
					n := subDis(num, discount)
					ans = fmt.Sprintf("%s$%s", ans, n) //替换后的单词加入
					i = j - 1
					break
				} else if j == len(sentence)-1 {
					num = sentence[i+1:]
					n := subDis(num, discount)
					ans = fmt.Sprintf("%s$%s", ans, n) //替换后的单词加入
					i = j
					break
				}
			}
		} else if i != 0 && i != len(sentence)-1 && sentence[i:i+2] == " $" {
			if i+1 == len(sentence)-1 { //i 对应空格 i+1对应$
				return fmt.Sprintf("%s $", ans)
			}
			for j = i + 2; j < len(sentence); j++ {
				if sentence[j] == ' ' {
					num = sentence[i+2 : j]
					n := subDis(num, discount)
					ans = fmt.Sprintf("%s $%s", ans, n) //替换后的单词加入
					i = j - 1
					break
				} else if j == len(sentence)-1 {
					num = sentence[i+2:]
					n := subDis(num, discount)
					ans = fmt.Sprintf("%s $%s", ans, n) //替换后的单词加入
					i = j
					break
				}
			}
		} else {
			ans = fmt.Sprintf("%s%s", ans, string(sentence[i]))
		}
	}
	return ans
}
